INSERT INTO `objective` (`obj_id`, `objective`) VALUES
(1, 'เพื่อสร้างความเป็นเลิศทางวิชาการและผลงานวิจัยที่สร้างผลกระทบเชิงบวกต่อการสร้างเสริมสุขภาพ'),
(2, 'เพื่อผลิตบัณฑิตและนักวิจัยที่มีศักยภาพรอบด้าน'),
(3, 'เพื่อสร้างองค์กรและสังคมแห่งการเรียนรู้ที่มีเอกลักษณ์ มีการพัฒนาคุณภาพทุกมิติ'),
(4, 'เพื่อขยายโอกาสทางการศึกษาและการวิจัย ด้วยการกำหนดมาตรการที่เป็นคุณและการให้โอกาส'),
(5, 'เพื่อส่งเสริมการแลกเปลี่ยนเรียนรู้ สร้างเครือข่ายทางวิชาการและการวิจัย'),
(6, 'เพื่อสร้างกลไกการพัฒนามหาวิทยาลัยในทุกพื้นที่ ด้วยการกำหนดเป็นแผนแม่บท'),
(7, 'เพื่อให้มหาวิทยาลัยเป็นแหล่งความรู้ และการบริการวิชาการแก่สังคมในด้านต่างๆ ที่มุ่งเน้นคุณภาพ'),
(8, 'เพื่อปรับเปลี่ยนกลไกบริหารของมหาวิทยาลัยด้วยการบริหารเชิงยุทธศาสตร์ และการมีส่วนร่วมทุกภาคส่วน'),
(9, 'เพือพัฒนาเทคโนโลยีสารสนเทศและระบบฐานข้อมูลที่สามารถรองรับการดำเนินงานตามพันธกิจมหาวิทยาลัย'),
(10, 'เพื่อกำหนดมาตรการบริหารความเสี่ยง และการลดค่าใช้จ่ายทางการบริหารโดยใช้ทรัพยากรอย่างคุ้มค่า');
