INSERT INTO `point_policy` (`poi_id`, `point`, `pol_id`) VALUES
(1, 'ปฏิรูปการศึกษาทั้งระบบ โดยปฏิรูปโครงสร้างและการบริหารจัดการ ปรับปรุงกฎหมาย\r\nให้สอดคล้องกับ รัฐธรรมนูญ และระดมทรัพยากรเพื่อการปรับปรุงการบริหารจัด\r\nการศึกษาตั้งแต่ระดับการศึกษาขั้น พื้นฐานจนถึงระดับอุดมศึกษา พัฒนาครู พัฒนา\r\nระบบการคัดเลือกเข้าสู่มหาวิทยาลัย พัฒนาหลักสูตรรวมทั้งปรับหลักสูตรวิชาแกนหลัก\r\nรวมถึงวิชาประวัติศาสตร์ ปรับปรุงสื่อการเรียนการสอน พัฒนาทักษะในการคิด\r\nวิเคราะห์ ปรับบทบาทการศึกษานอกโรงเรียนเป็นสำนักงานการศึกษาตลอดชีวิต และ\r\nจัดให้มีศูนย์การศึกษาตลอดชีวิตเพื่อการเรียนรู้ที่เหมาะสมในแต่ละพื้นที่ ตลอดจน\r\nส่งเสริมการกระจายอำนาจให้ทุกภาคส่วนมีส่วนร่วมในการจัดการศึกษา เพื่อนำไปสู่\r\nเป้าหมายคุณภาพการ ศึกษาและการเรียนรู้ที่มุ่งเน้นคุณธรรมนำความรู้อย่างแท้จริง', 1),
(2, 'พัฒนาครู อาจารย์ และบุคลากรทางการศึกษาเพื่อให้ได้ครูดี ครูเก่ง มีคุณธรรม มี\r\nคุณภาพ และมีวิทยฐานะสูงขึ้น ลดภาระงานครูที่ไม่เกี่ยวกับการเรียนการสอนตาม\r\nโครงการคืนครูให้นักเรียน มีการดูแลคุณภาพชีวิตของครูด้วยการปรับโครงสร้างหนี้\r\nและจัดตั้งกองทุนพัฒนาคุณภาพชีวิตครู ควบคู่ไปกับการลงทุนด้านเทคโนโลยี\r\nสารสนเทศที่เน้นการพัฒนาเนื้อหาสาระและบุคลากรให้พร้อมรองรับและใช้ ประโยชน์\r\nจากระบบเทคโนโลยีสารสนเทศได้อย่างคุ้มค่า', 1);
