(11111, 2555, 'การวิเคราะห์กระบวนการจัดระบบและกลไกงานประกันคุณภาพ : คณะสาธารณสุขศาสตร์ มหาวิทยาลัยมหิดล', NULL, 23, 0, 2, 2, 4, NULL, 3, 0, NULL, NULL, 1, 12, '<p><span style="font-size: medium;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; พระราชบัญญัติการศึกษาแห่งชาติ พ.ศ.2542 แก้ไขเพิ่มเติม (ฉบับที่ 2) พ.ศ.2545 กำหนดให้สถานศึกษาทุกแห่งจัดให้มีระบบการประกันคุณภาพภายในและให้ถือว่าการประกันคุณภาพภายในเป็นส่วนหนึ่งของกระบวนการบริหารการศึกษาที่ต้องดำเนินการอย่างต่อเนื่อง โดยมีการจัดทำรายงานประจำปีเสนอต่อหน่วยงานต้นสังกัด หน่วยงานที่เกี่ยวข้อง และเปิดเผยต่อสาธารณชน เพื่อนำไปสู่การพัฒนาคุณภาพและมาตรฐานการศึกษา และเพื่อรองรับการประกันคุณภาพภายนอก รวมถึงให้มีสำนักงานรับรองมาตรฐานและประเมินคุณภาพการศึกษาเพื่อทำหน้าที่พัฒนาเกณฑ์ วิธีการประเมินคุณภาพภายนอก และทำการประเมินผลการจัดการศึกษา เพื่อให้มีการตรวจสอบคุณภาพของสถานศึกษา โดยคำนึงถึงความมุ่งหมายและหลักการ และแนวทางจัดการศึกษาในแต่ละระดับ และให้มีการประเมินคุณภาพภายนอกของสถานศึกษาทุกแห่งอย่างน้อยหนึ่งครั้งในทุกห้าปีนับตั้งแต่การประเมินครั้งสุดท้าย และเสนอผลการประเมินต่อหน่วยงานที่เกี่ยวข้องและสาธารณชน</span></p>\r\n<p><span style="font-size: medium;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ระบบการประกันคุณภาพการศึกษาภายในสถานศึกษา เป็นส่วนหนึ่งของการบริหารการศึกษา ซึ่งเป็นกระบวนการพัฒนาคุณภาพการศึกษาอย่างต่อเนื่อง โดยให้สถานศึกษายึดหลักการมีส่วนร่วมของชุมชนและหน่วยงานที่เกี่ยวข้องโดยการส่งเสริม สนับสนุนและกำกับ ดูแลขอหน่วยงานต้นสังกัด</span></p>\r\n<p><span style="font-size: medium;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; คณะสาธารณสุขศาสตร์ มหาวิทยาลัยมหิดลได้เห็นความสำคัญของการประกันคุณภาพการศึกษา ซึ่งเป็นนโยบายของสำนักงานคณะกรรมการการอุดมศึกษาที่ได้กำหนดไว้ตามประกาศเรื่อง "นโยบายและแนวปฏิบัติในการประกันคุณภาพการศึกษาในระดับอุดมศึกษา" เมื่อวันที่ 8 กรกฎาคม พ.ศ.2539 และ "นโยบาย แนวทาง และปฏิบัติการประกันคุณภาพการศึกษาระดับอุดมศึกษา" เพื่อพัฒนาคุณภาพการศึกษาให้มีมาตรฐานและมีประสิทธิภาพ โดยแต่ละสถาบันมีอิสระในการดำเนินงาน คณะสาธารณสุขศาสตร์จึงได้จัดทำโครงการ กระบวนการจัดระบบและกลไกการประกันคุณภาพการศึกษาของคณะฯ</span></p>', 50, 3, '2011-10-01', '2012-08-31', '<p><span style="font-size: small;">1.&nbsp; เพื่อให้บุคลากรภายในคณะได้รับทราบระบบและกลไกการประกันคุณภาพของคณะสาธารณสุขศาสตร์</span></p>\r\n<p><span style="font-size: small;">2.&nbsp; เพื่อให้งานประกันคุณภาพการศึกษาของคณะสาธารณสุขศาสตร์มีความต่อเนื่องและบรรลุวัตถุประสงค์</span></p>', '<p>-</p>', 'ผู้บริหาร/บุคลากรภายในคณะสาธารณสุขศาสตร์', '300', 'คน', 'ภาควิชา/หน่วยงานในสำนักงานคณบดี', '1. เอกสารประกอบการประชุมและรายงานการประชุมคณะกรรมการพัฒนาคุณภาพ', 'งานแผนพัฒนาและระบบคุณภาพ', 90, 'ตามเป้าหมาย', 'ตรงเป้า', '', NULL, '2012-03-20 13:26:41', 'ph3', '', ''),
(11112, 2555, 'โครงการพัฒนาความพร้อมของนักศึกษาสู่ประชาคมอาเซืยน', NULL, 20, 0, 3, 2, 4, NULL, 3, 0, NULL, NULL, 1, 5, '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <span style="font-size: small;">ตามที่ประชาคมอาเซียนจะมีการเปิดเสรีทางเศรษฐกิจ ในปี 2558 ซี่งจะเป็นความร่วมมือกันในบูรณาการด้านการศึกษาสร้างสังคมความรู้ พัฒนาทรัพยากรมนุษย์ ส่งเสริมการจ้างงานที่เหมาะสม และส่งเสริม ICT ระหว่างประเทศอาเซียน 11 ประเทศ ดังนั้นการพัฒนาคุณภาพและศักยภาพของนักศึกษาจึงเป็นกลยุทธ์ที่สำคัญที่จะนำไปสู่เป้าหมายของมหาวิทยาลัยมหิดลที่มุ่งสู่การเป็นมหาวิทยาลัยหนึ่งในร้อยอันดับแรกของโลก และเนื่องจาก คณะสาธารณสุขศาสตร์ มหาวิทยาลัยมหิดล มีวิสัยทัศน์ที่จะเป็นองค์กรชั้นนำในการจัดการศึกษาและพัฒนาองค์ความรู้ด้านสาธารณสุข ที่นำไปสู่ความเป็นเลิศในการพัฒนาสุขภาพและคุณภาพชีวิตประชาชน ฝ่ายกิจการนักศึกษาจึงเห็นความสำคัญของการจัดกิจกรรมอย่างต่อเนื่องเพื่อพัฒนาความพร้อมของนักศึกษาวิทยาศาสตร์บัณฑิตศึกษาเพื่อเข้าสู่การแข่งขันในตลาดแรงงานทั้งในระดับประเทศและนานาชาติ และเพื่อสร้างความรู้สึกเป็นเจ้าของ อนุรักษ์มรดกทางวัฒนธรรมอาเซียน ส่งเสริมการสร้างสรรค์ด้านวัฒนธรรม ลดช่องว่างการพัฒนาสุขภาพเพื่อให้บัณฑิตเป็นพลเมืองที่ดีของประชาคมอาเซียนและประชาคมโลก</span></p>', 100, 3, '2011-10-01', '2012-09-30', '<p><span style="font-size: small;">9.1 เพื่อให้นักศึกษามีความรู้ ความเข้าใจ เกี่ยวกับวัฒนธรรมของแต่ละประเทศในสมาชิก</span></p>\r\n<p><span style="font-size: small;">9.2 เพื่อสร้างทักษะการสื่อสารระหว่างวัฒนธรรม</span></p>\r\n<p><span style="font-size: small;">9.3 เพื่อให้เกิดเครือข่ายความร่วมมือทางวิชาการระหว่างประเทศ</span></p>\r\n<p><span style="font-size: small;">9.4 เพื่อพัฒนาศักยภาพด้านการแข่งขันในตลาดแรงงาน</span></p>\r\n<p><span style="font-size: small;">9.5 เพื่อสร้างความรู้สึกเป็นเจ้าของ อนุรักษ์มรดกทางวัฒนธรรมของอาเซียน</span></p>', '', 'กลุ่มเป้าหมายคือนักศึกษาระดับปริญญาตรีและบัณฑิตศึกษา', '', '', 'คณะสาธารณสุขศาสตร์ มหาวิทยาลัยมหิดล และมหาวิทยาลัยต่างประเทศ', '<P>1.ค่าวัสดุ</P>\r\n<P>2.ค่ายานพาหนะในการเดินทาง</P>\r\n<P>3.ค่าเบี้ยเลี้ยงในการดำเนินงาน</P>\r\n<P>4.ค่าตอบแทนวิทยากร</P>\r\n<P>5.ค่าเอกสาร</P>', 'คณะสาธารณสุขศาสตร์', 0, '', '', '', NULL, '2012-03-20 13:31:32', 'ph5', '', ''),
(11113, 2555, 'โครงการแผนพัฒนาระบบสารสนเทศฯ', NULL, 23, 0, 3, 2, 8, NULL, 9, 0, NULL, NULL, 6, 9, '<p>&nbsp;&nbsp;&nbsp; <span style="font-size: large;">การบริหารจัดการความเสี่ยงเป็นเรื่องสำคัญ และหลีกเลี่ยงไม่ได้ แม้แต่ในเรื่องใกล้ตัวเกี่ยวกับการปฏิบัติงาน ซึ่งดำเนินการทุกเรื่องอาจเกิดความเสี่ยงขึ้นได้ และอาจส่งผลกระทบต่อความสำเร็จในการปฏิบัติงาน เช่น ด้านงบประมาณ ด้านการศึกษา ด้านสารสนเทศ ด้านกระบวนการทำงาน ด้านบริหารจัดการ และความเสี่ยงด้านเทคนิค หากไม่ได้รับการดูแลเอาใจใส่ วางแผนปฏิบัติการ แก้ไข ติดตามประเมินผล จะก่อให้ผลเสียหายอย่างร้ายแรงต่อการปฏิบัติงานในแต่ละประเภทได้ ดังนั้น เพื่อลดผลกระทบต่อความเสี่ยงดังกล่าว คณะฯ จึงมีความจำเป็นต้องจัดทำโปรแกรมการบริหารความเสี่ยงเพื่อเตรียมการเฝ้าระวังจากผลการดำเนินงานการ</span></p>\r\n<p><span style="font-size: large;">บริหารความเสี่ยงให้น้อยลง&nbsp; หรือไม่มีเลย รวมทั้งผู้บริหารนำ</span></p>', 70, 3, '2012-03-20', '2012-09-28', '<p><span style="font-size: medium;">1.&nbsp; เพื่อลดขั้นตอนในการปฏิบัติงานของภาควิชา/หน่วยงาน</span></p>\r\n<p><span style="font-size: medium;">2.&nbsp; เพื่อลดปัญหาอันเกิดจากการเสี่ยงให้ลดลง หรือไม่มีความเสี่ยงเลย</span></p>\r\n<p><span style="font-size: medium;">3.&nbsp; เพื่อให้การเก็บข้อมูลด้านบริหารจัดการความเสี่ยงอย่างมีระบบ มีความละเอียด มีความถูกต้อง และครบถ้วนมากยิ่งขึ้น</span></p>', '<p>ปี 2554 - มีผลการดำเนินงาน&nbsp; จำนวน 15 ครั้ง</p>', 'ผู้บริหาร/บุคลากรที่รับผิดชอบข้อมูลรายงานผลการบริหารจัดการความเสี่ยง', '100', 'คน', 'ภาควิชา/หน่วยงานในสำนักงานคณบดี', '1.&nbsp; บุคลากรที่ให้ข้อมูลเกี่ยวกับระบบการบริหารความเสี่ยง', 'งานแผนพัฒนาและระบบคุณภาพ', 79, 'llllllllllllllllllllllllllllllllllllllll', 'สสสสสสสสสสสสสสสสสสสสสสสสสสสสสสสสส', '', NULL, '2012-03-20 13:32:05', 'ph1', '', ''),
(11114, 2555, 'โครงการพัฒนาความเป็นศูนย์กลางฝึกอบรมนโยบายด้านสุขภาพ', NULL, 24, 0, 3, 1, 5, NULL, 0, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', '', '', 0, '', '', '', NULL, '2012-03-20 13:32:24', 'ph4', '', ''),
(11115, 2555, 'โครงการพัฒนาความเป็นศูนย์กลางฝึกอบรมนโยบายด้านสุขภาพ', NULL, 24, 0, 3, 1, 5, NULL, 7, 0, NULL, NULL, 5, NULL, '<p>&nbsp;&nbsp; คณะสาธารณสุขศาสตร์ มหาวิทยาลัยมหิดล เป็นคณะเก่าแก่ทางด้านสาธารณสุขศาสตร์ของประเทศ มีวิสัยทัศน์ที่จะนำคณะให้เป็นสถาบันการศึกษาสาธารณสุขชั้นนำในภูมิภาคเอเซีย เป็นศูนย์กลางการฝึกอบรม นโยบายด้านสุขภาพแก่คณะสาธารณสุขศาสตร์ในมหาวิทยาลัยอื่นๆ ของประเทสไทย และภูมิภาค ตลอดจนหน่วยงานในองค์กรอื่นๆทั่วโลก</p>\r\n<p>&nbsp;&nbsp;&nbsp; ด้วยเหตุนี้ จึงมีโครงการพัฒนาความเป็นศูนย์กลาง ฝึกอบรมนโยบายด้านสุขภาพ เพื่อเป็นแหล่งในการขับเคลื่อนเจรจากับภาคีและ</p>', NULL, NULL, '2011-02-01', '2013-10-31', '<p>&nbsp;&nbsp;&nbsp; จัดตั้งศูนย์กลางในการฝึกอบรมพัฒนา นโยบายด้านสุขภาพของภูมิภาค</p>', '', 'ผู้เชี่ยวชาญ นักวิชาการ เครือข่ายความร่วมมือภูมิภาคอาคเนย์', '1-2', 'ครั้ง', 'คณะสาธารณสุขศาสตร์ ม.มหิดล', '', '', 0, '', '', '', NULL, '2012-03-20 13:36:34', 'ph4', '', ''),
