(11130, 2555, 'โครงการปรับปรุงสัญญาณเครือข่ายภายในคณะสาธารณสุขศาสตร์', NULL, 25, 0, 3, 2, 8, NULL, 9, 0, NULL, NULL, 6, 9, '<p><span style="font-size: medium;">ด้วยคณะได้ติดตั้งและใช้งานระบบเครือข่ายภายในคณะมาตั้งแต่ปี 2545 เป็นต้นมา ในระยะแรกการเชื่อมต่อสายสัญญาณเครือข่ายภายในเป็นการดำเนินการจากบุคลากรภายในคณะดำเนินการเอง เชื่อมต่อโดยเดินสายสัญญาณเพิ่มเติมตามจำนวนผู้ใช้งานภายในอาคาร ดังนั้น ระยะเวลาในการเดินสายสัญญาณจากอดีตจนถึงปัจจุบันมีอายุการใช้งานมานาน ทำให้มีการเสื่อมสภาพของสายสัญญาณดังกล่าว</span></p>', 625, 1, '2011-10-01', '2012-09-30', '<p><span style="font-size: medium;">1. พัฒนาสายสัญญาณเครือข่ายภายใน ให้มีสภาพเหมาะสมในการใช้งาน </span></p>\r\n<p><span style="font-size: medium;">2. จำนวนจุดเชื่อมต่อเพียงพอต่อการใช้งาน</span></p>\r\n<p><span style="font-size: medium;">3. สามารถใช้งานระบบ Internet ได้รวดเร็วอยู่เสมอ</span></p>', '<p>ไม่มี</p>', 'กลุ่มเป้าหมาย บุคลากรภายในอาคารนั้นๆ', '100', 'คน', 'อาคารภายในคณะฯ', '<P>1. บุคลากรในงานเทคโนโลยีสารสนเทศและการสื่อสาร</P>\r\n<P>2. บุคลากรสำนักงานคณบดี</P>', '<P>1. กำหนดคุณสมบัติเฉพาะ ควบคุมการปฏิบัติงาน</P>\r\n<P>2. จัดทำแผนผังจำนวนจุดเชื่อมต่อ</P>', 0, '', '', '', NULL, '2012-03-28 14:47:05', 'ph1', '', ''),
