(11145, 2555, 'โครงการประชาสัมพันธ์ภาควิชาอาชีวอนามัยและความปลอดภัย', NULL, 13, 0, 3, 2, 4, NULL, 3, 0, NULL, NULL, 1, 9, '<p>จากคะแนนสอบเข้าเรียนหลักสูตรอาชีวอนามัยและความปลอดภัยที่มีคะแนนสูงสุดในกลุ่มสาขาวิชานี้ อย่างไรก็ตามหากไม่มีการส่งเสริมให้หลักสูตรนี้เป็นที่รู้จักกันในกลุ่มนักเรียนระดับมัธยมศึกษาและอาจารย์แนะแนวหรือผู้บริหารโรงเรียน อาจทำให้มีผู้สมัครรียนสาขานี้ไม่มากเท่าที่ควรจะเป็น ดังนั้นควรจะมีการประชาสัมพันธ์ให้กับกลุ่มเป้าหมาย คือโรงเรียนที่มีนักเรียนสอบเข้ามาเรียนหลักสูตรนี้ ปีละประมาณ ๖๐ คน รวบสี่ปีแล้วมีกลุ่มโรงเรียนเป้าหมายประมาณมากกว่า ๒๐๐ แห่ง ซึ่งอาจจะมีนักศึกษาที่มาจากโรงเรียนเดียวกันบ้าง</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;หลักการในการประชาสัมสัมธ์คือการใหนักศึกษาปัจจุบันส่งซีดีที่มีข้อมูลประชาสัมพันธ์ของมหาวิทยาลัย ของคณะสาธารณสุข และข้อมูลของภาควิชาฯ โดยข้อมูลนี้จะจัดทำเป็นภาพยนต์สั้นๆ ให้มีความน่าสนใจ เข้าใจง่าย เหมาะกับวัยของนักเรียนระดับมัธยมปลาย ให้ทราบว่าเรียนจบสาขานี้แล้วสามารถประกอบอาชีพอะไรได้บ้าง การส่งข้อมูลทางไปรษณีย์โครงการเป็นผู้รับผิดชอบค่าใช้จ่ายโดยมีนักศึกษาที่เป็นศิษย์เก่าของโรงเรียนมัธยมเป็นผู้ติดตามประสานงานกับโรงเรียนของแต่ละคน</p>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; การประเมินสามารถทำได้โดยพิจารณาจากการเพิ่มขึ้นของคะแนนสอบเข้า และจำนวนผู้เลือกเรียนหลักสูตรนี้</p>', 56000, 3, '2012-03-15', '2012-03-28', '<table style="width: 699px;" border="1" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td width="699" valign="top"><ol>\r\n<li>เพื่อให้โรงเรียนในกลุ่มเป้าหมายรู้จัดหลักสูตรมากขึ้น</li>\r\n<li>เพื่อให้มีจำนวนผู้สมัครสอบเพื่อเข้าเรียนคณะนี้มากขึ้น</li>\r\n</ol></td>\r\n</tr>\r\n<tr>\r\n<td width="699" valign="top">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>', '', 'โรงเรียนมัธยมของนักศึกษาหลักสูตรนี้', '200', 'แห่ง', 'ภาควิชาอาชีวอนามัยและความปลอดภัย', '<SPAN style="FONT-FAMILY: ''TH SarabunPSK'',''sans-serif''; FONT-SIZE: 14pt; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: TH" lang=TH>อุปกรณ์ถ่ายทำภาพยนต์และตัดต่อ</SPAN>', '<SPAN style="FONT-FAMILY: ''TH SarabunPSK'',''sans-serif''; FONT-SIZE: 14pt; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: TH" lang=TH>ว่าจ้างบริษัทถ่ายทำ ร่วมกับหน่วยงานของคณะฯ</SPAN>', 0, '', '', '', NULL, '2012-03-28 14:49:17', 'ph4', '', ''),
