INSERT INTO `strategic_faculty` (`sf_id`, `sf_name`, `sf_parent`, `modified`) VALUES
(1, '1. สร้างความเข้มแข็งของเครือข่ายงานวิจัยและการศึกษา', 0, ''),
(2, '2. พัฒนาวิชาการโดย ใช้กลไกการตลาด ผ่านเครือข่ายทั้งใน ระดับชาติและ นานาชาติ', 0, ''),
(3, '3. พัฒนาการบริหาร จัดการงานวิจัย หลักสูตร ระบบ สารสนเทศเพื่อการ จัดการและบริการวิชาการสู่การ แข่งขันเชิงพาณิชย์', NULL, NULL),
(4, '4. พัฒนาและบริหาร ทรัพยากรให้เกิด ประโยชน์สูงสุด', NULL, NULL);
INSERT INTO `str_fac2` (`id`, `name`, `sf_id`) VALUES
(1, '1.1เพิ่มบทบาทคณะ\r\nสาธารณสุขศาสตร์\r\nในสังคมประเทศ\r\nไทยและนานาชาติ', 1),
(2, '1.2 เสริมสร้างความ\r\nแข็งแกร่งทางวิชา\r\nการและวิจัยทั้งใน\r\nศาสตร์เดียวกัน\r\nและการบูรณาการ\r\nระหว่างศาสตร์และ\r\nเครือข่ายในสังคมประเทศไทยและ\r\nนานาชาติ', 1),
(3, '2.1 สร้างความ\r\nสามารถการ\r\nแข่งขันให้สูงขึ้น\r\nโดยใช้กลไกตลาด', 2),
(4, '2.2 แสวงหาทุนวิจัย\r\nและทุนสนับสนุน\r\nวิชาการเพิ่มขึ้น', 2),
(5, '2.3 พัฒนาการประชา\r\nสัมพันธ์เชิงรุก', 2),
(6, '3.1 ส่งเสริมให้มีการนำ\r\nความรู้และประสบ\r\nการณ์จากการ\r\nบริการวิชาการ/\r\nการวิจัยสู่การเรียน การสอน', 3),
(7, '3.2 สร้างบัณฑิตคณะ\r\nสาธารณสุขศาสตร์\r\nให้มีคุณภาพและ\r\nเอกลักษณ์', 3),
(8, '3.3 พัฒนาระบบ\r\nเทคโนโลยีสารสน-\r\nเทศเพื่อการ\r\nบริหารและการ\r\nบริการวิชาการ', 3),
(9, '4.1 สร้างธรรมาภิบาล\r\nการบริหาร', 4),
(10, '4.2ใช้งบประมาณอย่าง\r\nคุ้มค่า', 4),
(11, '4.3พัฒนาระบบบริหาร\r\nทรัพยากรบุคคล\r\nของคณะ', 4),
(12, '4.4เพิ่มความคล่องตัว\r\nในการบริหาร', 4);
INSERT INTO `str_fac3` (`id`, `name`, `parent1`, `parent2`) VALUES
(1, '1.1.1จำ นวนบทความวิจัย\r\nตีพิมพ์ในวารสารวิชาการ\r\nระดับชาติและนานาชาติ\r\n(เฉลี่ย 1 เรื่อง/คน/ปี)\r\n(ปี 2554, 2555)', 1, 1),
(2, '1.1.2 ร้อยละของดัชนีการอ้าง\r\nอิงที่เพิ่มขึ้นเมื่อเทียบกับ\r\nปีงบประมาณที่ผ่านมา\r\n(ร้อยละ 10/ปี)', 1, 1),
(3, '1.1.3จำนวนงานวิจัยที่จด\r\nทรัพย์สินทางปัญญา\r\n(1 ชิ้นงาน/ปี)', 1, 1),
(4, '1.1.4ร้อยละผลงานวิจัยที่\r\nนำไปใช้ประโยชน์ใน\r\nระดับประเทศ(ร้อยละ10\r\nของผลงานวิจัย)', 1, 1),
(5, '1.2.1จำนวนโครงการความ\r\nร่วมมือทางวิชาการ\r\nระหว่างศาสตร์และ\r\nเครือข่ายในประเทศและ\r\nนานาชาติ(5 โครงการ/ปี)', 1, 2),
(6, '2.1.1 ระดับความพึงพอใจของ\r\nผู้ใช้บัณฑิตไม่ต่ำกว่า4\r\nต่อ 5 คะแนน', 2, 3),
(7, '2.1.2 อัตราการได้งานของ\r\nบัณฑิต (ตามเกณฑ์\r\nมหาวิทยาลัย)', 2, 3),
(8, '2.2.1 อัตราส่วนระหว่างทุน\r\nสนับสนุนที่ได้รับต่อ\r\nแหล่งทุนที่เสนอขอ', 2, 4),
(9, '2.2.2 ร้อยละของงบประมาณที่\r\nได้รับจากหน่วยงาน\r\nภายนอกเมื่อเทียบกับ\r\nปีงบประมาณที่ผ่านมา\r\n(ร้อยละ50)', 2, 4),
(10, '2.3.1 ร้อยละของการรับรู้ของ\r\nประชาคมในคณะ\r\n(1. ร้อยละ 70-80 ของบุคลากร\r\nทั้งหมด)\r\n(2. ร้อยละ 80 ของจำนวนเรื่อง\r\nได้รับการประชาสัมพันธ์ใน\r\nคณะ)', 2, 5),
(11, '2.3.2 จำนวนเรื่อง/โครงการที่\r\nได้ดำเนินการประชา\r\nสัมพันธ์เชิงรุกในระดับ\r\nประเทศ (ร้อยละ20)\r\nและระดับนานาชาติ\r\n(ร้อยละ 5)', 2, 5),
(12, '3.1.1 จำนวนเอกสารคำสอน\r\nและตำราที่เรียบเรียงจาก\r\nผลงานวิชาการและวิจัย\r\nของตนเองและนักคิดอื่น\r\n(1. เอกสารคำสอน 20 ชุด/ปี 2. ตำรา 10 เล่ม/ปี)', 3, 6),
(13, '3.1.2 ร้อยละของงานวิจัยที่\r\nนำไปสู่การเรียนการ\r\nสอนเมื่อเทียบกับจำนวน\r\nงานวิจัยทั้งหมด\r\n(ร้อยละ 80)', 3, 6),
(14, '3.2.1 ระดับความพึงพอใจของ\r\nผู้ใช้บัณฑิตทุกระดับ\r\n(ร้อยละ 80)', 3, 7),
(15, '3.2.2จำนวนรางวัลที่บัณฑิต\r\nได้รับจากสังคม\r\n(10 รางวัล/ปี)', 3, 7),
(16, '3.3.1 จำนวนฐานข้อมูลที่\r\nทันสมัย (ทุกฐานข้อมูล)', 3, 8),
(17, '3.3.2 จำนวนสารสนเทศที่\r\nผู้บริหารนำไปใช้ในการ\r\nบริหารและบริการ\r\nวิชาการ (10 เรื่อง)', 3, 8),
(18, '4.1.1จำนวนเรื่องร้องเรียน\r\n(ไม่มีเรื่องร้องเรียน)', 4, 9),
(19, '4.2.1ร้อยละของอัตราการเบิก\r\nจ่ายเงินงบประมาณ\r\nรายจ่ายลงทุน/รายจ่าย\r\nรวม (ร้อยละ 95)', 4, 10),
(20, '4.2.2ร้อยละของความสำเร็จ\r\nตามเป้าหมายผลผลิต\r\n(ร้อยละ 85)', 4, 10),
(21, '4.3.1จำนวนชั่วโมงต่อบุคลากร\r\nที่เข้ารับการฝึกอบรมเพื่อ\r\nพัฒนาตนเอง\r\n(20 ชั่วโมง/คน)', 4, 11),
(22, '4.4.1ร้อยละความสำเร็จของ\r\nหน่วยงานในการลดระยะเวลาการให้บริการ\r\nของหน่วยงานบริการ\r\n(1 หน่วย/ปี)', 4, 12);
INSERT INTO `str_goal` (`id`, `name`, `sub_str_id`, `str_id`) VALUES
(1, '1. จำนวนบทความ ตีพิมพ์ในวารสาร ระดับนานาชาติ เฉลี่ย 1 บทความ ต่อบุคลากรสาย วิชาการต่อปี', 3, 1),
(2, '2. จำนวนดัชนีการ อ้างอิง(Citation Index) เพิ่มขึ้น 10% ต่อปี', 3, 1),
(3, '3. รายได้ที่เกิดจาก ทรัพย์สินทาง ปัญญญาของ มหาวิทยาลัย มหิดลเพิ่มขึ้น 5% ต่อปี', 3, 1),
(4, '1. จำนวนผลงานโดด เด่น/รางวัล ของ นักศึกษาและ บุคลากร', 4, 1),
(5, '2. อัตราการได้งาน ของบัณฑิต', 4, 1),
(6, '3. ผู้ใช้บัณฑิตมีความ พึงพอใจไม่ต่ำกว่า ระดับ 4ต่อ5คะแนน', 4, 1),
(7, '1. ร้อยละของ ผู้รับบริการที่มี ความพึงพอใจใน การบริการไม่ต่ำ กว่า ระดับ 3.75 ต่อ 5 คะแนน', 5, 1),
(8, '2. บุคลากรหรือ มหาวิทยาลัยได้รับ การรับรองคุณภาพ ระดับชาติหรือ นานาชาติ และ/ หรือรางวัลจากการ บริการสุขภาพใน ระดับประเทศ/โลก ทุกปี', 5, 1),
(9, '3. จำนวนนวัตกรรม ด้านบริการที่ เพิ่มขึ้นต่อปี', 5, 1),
(10, '1. มหาวิทยาลัยมหิดล ได้รับการจัดอันดับ ดีขึ้นในระดับโลก', 6, 1);
INSERT INTO `sub_point_policy` (`sub_id`, `subname`, `poi_id`, `pol_id`, `modified`) VALUES
(1, 'เร่งรัดพัฒนาคุณภาพการศึกษาทุกระดับ ทุกประเภท ตั้งแต่ระดับการศึกษาขั้นพื้นฐาน\r\nจนถึงระดับอุดมศึกษา รวมถึงการศึกษาตลอดชีวิต พร้อมทั้งสร้างกระบวนการเรียนรู้\r\nปลูกฝังจิตสำนึก ค่านิยม คุณธรรมวัฒนธรรมตามหลักเศรษฐกิจพอเพียงแก่ผู้เรียน\r\nโดยความร่วมมือของเครือข่าย บ้าน สถาบัน ศาสนา สถานศึกษา ชุมชนและสื่อ', 1, 1, ''),
(2, 'ให้มีการปฏิรูปการเงินการคลัง เพื่อการศึกษาที่เป็นระบบอย่างจริงจัง เพื่อให้การ\r\nลงทุนด้านการศึกษา และการเรียนรู้มีความเหมาะสมยิ่งขึ้น เน้นการระดมความ\r\nร่วมมือทุกภาคส่วนเพื่อพัฒนาการศึกษา', 1, 1, ''),
(3, 'ปรับระบบการคัดเลือกเข้าศึกษาต่อระดับอุดมศึกษาให้มีความเป็นธรรม สามารถ\r\nคัดเลือกผู้เรียนได้ ศึกษาต่อตามความต้องการและความถนัดอย่างแท้จริง', 1, 1, ''),
(4, 'พัฒนาระบบบริหารจัดการและกฎหมายด้านการศึกษา โดยการส่งเสริมสนับสนุนการ\r\nกระจายอำนาจการจัดการศึกษา ส่งเสริมการมีส่วนร่วมในการจัดการศึกษา ควบคู่กับ\r\nเร่งรัดการถ่ายโอนสถานศึกษาที่ผ่าน การประเมินความพร้อมให้แก่องค์กรปกครอง\r\nส่วนท้องถิ่น พร้อมทั้งพัฒนาบุคลากร ระบบการบริหารและจัดการศึกษา การจัดการ\r\nความรู้ขององค์กรปกครองส่วนท้องถิ่นให้มีศักยภาพในการจัดการศึกษา', 1, 1, ''),
(5, 'กำหนดแผนการผลิต และพัฒนาครู คณาจารย์อย่างเป็นระบบให้สอดคล้องกับสภาพ\r\nการใช้และความ ต้องการ รวมทั้งสร้างกระบวนการในการคัดเลือกคนเก่ง คนดีเข้ามา\r\nเป็นครูโดยการสร้างสิ่งจูงใจให้เด็กเก่งสนใจเข้าเรียนต่อครูเพิ่มขึ้น อาทิ การให้ทุนการ\r\nศึกษา การสร้างความมั่นใจ ความก้าวหน้าของ อาชีพครู เช่น รายได้ค่าตอบแทนและ\r\nสวัสดิการที่มีความเหมาะสมและสามารถดำรงชีวิตได้อย่างมีศักดิ์ศรี', 2, 1, ''),
(6, 'สร้างเสริม และพัฒนาทักษะด้านการใช้เทคโนโลยีสารสนเทศ เพื่อรองรับและใช้\r\nประโยชน์ จากระบบเทคโนโลยีสารสนเทศได้อย่างคุ้มค่า', 2, 1, '');
